import React from "react";

export const Selector = () => {
  return (
    <div>
      <select class="mt-1 mr-8">
        <option>Option 1</option>
        <option>Option 2</option>
      </select>
      <select>
        <option selected hidden>
          Make
        </option>
      </select>
      <select>
        <option selected hidden>
          Model
        </option>
      </select>
    </div>
  );
};
